  },
  {
    participantImage: tes2,
    participantName: 'Joko Kendil',
    participatDepartment: 'Statistika',
    participantKompetisi: 'Karate'
  },
  {
    participantImage: tes3,
    participantName: 'Joko Kendil',
    participatDepartment: 'Statistika',
    participantKompetisi: 'Karate'
  },
]

const KontingenParticipant = () => {
  return (
    <div className='spirit__kontingen-participant section__padding'>
      {participantData.map((item, index) => (
        < Participant 
          participantImage={item.participantImage} 
          participantName={item.participantName}
          participantDepartment={item.participatDepartment}
          participantKompetisi={item.participantKompetisi}
        />
      ))}
    </div>
  )
}

export default KontingenParticipant
